import logo from "./logo.svg";
import "./App.css";
import React, { useState } from "react";

function App() {
  const [text, setText] = useState([1, 2, 3]);

  function setList() {
    const input = document.querySelector("#input");
    let copy = [...text];
    copy.push(input.value);
    let listedEl = copy[copy.length - 1];
  }

  return (
    <div className="App">
      <input id="input"></input>
      <button className="btn" onClick={setList}>
        저장!
      </button>
      <div className="list">{listedEl}</div>
    </div>
  );
}

export default App;
